import React from 'react';
import './home.css';
import {useNavigate} from 'react-router-dom';

function homePage(){ 

    const navigate = useNavigate();
    const gotoResult = () =>{
        navigate('/result');
    }
    return (
      <div className="Home">
        <div className="upperTitle">
          <p>MBTI</p>
          <button>관리자 페이지</button>
        </div>

        <div className="chooseMbti">
          <div className="upperMbti">
             <button>E</button>
             <button>S</button>
             <button>T</button>
             <button>J</button>
          </div>

          <div className="meanMbti">
            <p>에너지 방향</p>
            <p>인식 방식</p>
            <p>판단</p>
            <p>생활 양식</p>
          </div>

           <div className="lowerMbti">
              <button>I</button>
              <button>N</button>
              <button>F</button>
              <button>P</button>
           </div>

           <div className="okBtn">
               <Link to ='/result'>확인</Link>
              <input type='submit' value={"확인"} onClick={()=>gotoResult}/>
           </div>
        </div>

        <div className="lowerTitle"></div>
      </div>
    );
};

export default homePage;
